name: algorithm-test
variants:
  - name: CC1314R10
    cores:
    - name: main
      type: armv8m
      core_access_options:
        !Arm
          ap: 0
          psel: 0
    jtag:
      scan_chain:
        - name: core0
          ir_len: 4
        - name: ICEPICK
          ir_len: 6
    memory_map:
    - !Ram
        range:
          start: 0x20000000
          end: 0x20010000
        is_boot_memory: false
        cores:
        - main
    - !Nvm
        range:
          start: 0
          end: 0x100000
        is_boot_memory: true
        cores:
        - main
    - !Nvm
        range:
          start: 0x50000000
          end: 0x50000800
        is_boot_memory: false
        cores:
        - main
    flash_algorithms:
      - algorithm-test
      - algorithm-test2
flash_algorithms:
  - name: algorithm-test
    description: A flash algorithm under test
    cores:
      - main
    default: true
    instructions: 
    pc_init: 0x0
    pc_uninit: 0x0
    pc_program_page: 0x0
    pc_erase_sector: 0x0
    pc_erase_all: 0x0
    data_section_offset: 0x0
    # load_address: 0x20002144
    flash_properties:
      address_range:
        start: 0x0
        end: 0x100000
      page_size: 0x0
      erased_byte_value: 0x0
      program_page_timeout: 0x0
      erase_sector_timeout: 0x0
      sectors:
        - size: 0x0
          address: 0x0
  - name: algorithm-test2
    description: A flash algorithm under test
    cores:
      - main
    default: true
    instructions: 
    pc_init: 0x0
    pc_uninit: 0x0
    pc_program_page: 0x0
    pc_erase_sector: 0x0
    pc_erase_all: 0x0
    data_section_offset: 0x0
    # load_address: 0x20002144
    flash_properties:
      address_range:
        start: 0x50000000
        end: 0x50000800
      page_size: 0x0
      erased_byte_value: 0x0
      program_page_timeout: 0x0
      erase_sector_timeout: 0x0
      sectors:
        - size: 0x0
          address: 0x0